import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import archive from '../../assets/icons/albums.svg';
import Chip from '@material-ui/core/Chip';
import Card from '@material-ui/core/Card';


const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',

    '& > *': {
      margin: theme.spacing(1),
      width: theme.spacing(20),
      height: theme.spacing(20),
    },
  },

  image: {
    top: '1414px',
    left: '534px',
    width: '78px',
    height: '49px',
    justify: 'center',
    marginTop: '50px'

  },
  title: {
    wrap: 'nowrap',
    justifyContent: 'center',
    textAlign: 'center',
  },
  button: {
    width: '130px',
    height: '32px',
    background: '#FFEFE5 0% 0% no-repeat padding-box',
    borderRadius: '16px',
    opacity: '1',
    textAlign: 'center',
    font: 'Regular 16px/24px Roboto',
    letterSpacing: '0px',
    color: '#FE9D00',
    opacity: ' 1',
    marginLeft: '600px'
  },
  buttons: {
    width: '180px',
    height: '48px',
    opacity: '1',
    textAlign: 'center',
    font: ' Regular 16px/24px PT Sans',
    letterSpacing: '0px',
    color: '#4DB6AC',
    opacity: '1',
  },
  card: {
    width: "370px",
    height: "324px",

  },
  para: {
    marginLeft: '500px'
  },
  line: {
    marginLeft: '600px'
  },
  paragraph: {
    font: "Regular 16px/24px PT Sans",
    letterSpacing: "0px",
    color: "#868E96",
    opacity: "1",
    height: '52px',
    width: "310px",
    justifyContent: 'center',
    marginLeft: '30px'
  }
}));
const Cards = (props) => {
  const classes = useStyles(props);

  return (
    <Card className={classes.card}>
      <img src={archive} alt="logo" className={classes.image} />
      <h4>District population</h4>
      <p className={classes.paragraph}>
        This should be used to tell a story and let your users know more
        about your service. How can you benefit them?
          </p>
      <Chip size="small" Slabel="342+ DATASETS"></Chip>
    </Card>
  );

}
export default Cards;
